INSERT INTO `tournament` (`id`,`name`,`description_no`,`description_en`,`startDate`,`endDate`,`times`,`createdById`,`clubId`,`venueId`,`providesLodging`,`providesTransport`,`providesBanquet`) VALUES (1,'Haugesund Klubbmesterskap 2017','Velkommen til treningshelg og vårt aller første Klubbmesterskap!\nDet avholdes i Haugesund Turnhall denne gang.','Velkommen til treningshelg og vårt aller første Klubbmesterskap!\nDet avholdes i Haugesund Turnhall denne gang.','2017-12-09 23:00:00.000','2017-12-09 23:00:00.000','[{\"day\": 0, \"time\": \"12,21\"}]',1,1,2,0,0,0);
INSERT INTO `tournament` (`id`,`name`,`description_no`,`description_en`,`startDate`,`endDate`,`times`,`createdById`,`clubId`,`venueId`,`providesLodging`,`providesTransport`,`providesBanquet`) VALUES (2,'Ingeborgs Minnepokal 2018','Ingeborgs minnepokal er første kretskonkurranse i år for troppsgymnaster. Vi ønsker alle velkomne for å se både våre egne og andre turnere fra Rogaland.\n\nInngangsbillett: Voksen 100,- Barn 50,- Familie 200,-\n\nVi gleder oss til å ta imot store og små gymnaster fra hele kretsen.\n\nDet er mange påmeldte, og vi ser frem til en lang og kjekk dag i hallen.\n\n\n**Sted:**\nHaraldshallen\nHanne Hauglands veg 8\n5519 Haugesund\n\n\n\n**Dommer & Lagledermøte: ** kl 11.00 *(i kafeen til Turnhallen; nabobygget til Haraldshallen) *\n**Trening:**                                  kl 09.00 – 12.45 \n**Innmarsj:**                                kl 12.45\n**Konkurransestart:**                kl 13.00 \n\nGarderober vil bli merket med lag, og ligger i kjelleren i Haraldshallen.  \n\nLunsj til gymnaster/ trenere kan hentes i kiosken i Haraldshallen fra klokken 11.00.\n\nAspiranter kjører først, innimellom frittstående kjøringene.\nAspirantene vil få utdelt sine premier før vi fortsetter tumbling og trampett kjøringene,\nslik at de ikke trenger å ha hele dagen i hallen.\n\n1/3 premiering for rekrutt, junior og senior.\nDeltakerpremier til alle.\n\n\n\n**Med vennlig hilsen**\n\nTeknisk komite Troppsgymnastikk Haugesund Turnforening\n\n\n\nKontakt personer før og under konkurransen:\nVidar Støyva Vidar:   [911 90 991](tel://91190991) / vidar@haugnett.no (Påmelding)\nKirsti Sveindal:          [470 17 830](tel://47017830) / kirsti@katarsis.no (Lagleder-­/dommermøte) \nPetter Reffhaug:       [484 46 235](tel://48446235) / petter@jyslabra.no (Kretsens representant)\n','Ingeborgs minnepokal er første kretskonkurranse i år for troppsgymnaster. Vi ønsker alle velkomne for å se både våre egne og andre turnere fra Rogaland.\n\nInngangsbillett: Voksen 100,- Barn 50,- Familie 200,-\n\nVi gleder oss til å ta imot store og små gymnaster fra hele kretsen.\n\nDet er mange påmeldte, og vi ser frem til en lang og kjekk dag i hallen.\n\n\n**Sted:**\nHaraldshallen\nHanne Hauglands veg 8\n5519 Haugesund\n\n\n\n**Dommer & Lagledermøte: ** kl 11.00 *(i kafeen til Turnhallen; nabobygget til Haraldshallen) *\n**Trening:**                                  kl 09.00 – 12.45 \n**Innmarsj:**                                kl 12.45\n**Konkurransestart:**                kl 13.00 \n\nGarderober vil bli merket med lag, og ligger i kjelleren i Haraldshallen.  \n\nLunsj til gymnaster/ trenere kan hentes i kiosken i Haraldshallen fra klokken 11.00.\n\nAspiranter kjører først, innimellom frittstående kjøringene.\nAspirantene vil få utdelt sine premier før vi fortsetter tumbling og trampett kjøringene,\nslik at de ikke trenger å ha hele dagen i hallen.\n\n1/3 premiering for rekrutt, junior og senior.\nDeltakerpremier til alle.\n\n\n\n**Med vennlig hilsen**\n\nTeknisk komite Troppsgymnastikk Haugesund Turnforening\n\n\n\nKontakt personer før og under konkurransen:\nVidar Støyva Vidar:   [911 90 991](tel://91190991) / vidar@haugnett.no (Påmelding)\nKirsti Sveindal:          [470 17 830](tel://47017830) / kirsti@katarsis.no (Lagleder-­/dommermøte) \nPetter Reffhaug:       [484 46 235](tel://48446235) / petter@jyslabra.no (Kretsens representant)\n','2018-03-17 23:00:00.000','2018-03-17 23:00:00.000','[{\"day\": 0, \"time\": \"13,20\"}]',1,1,1,0,0,0);
